// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

/// @title A title that should describe the contract/interface
/// @author The name of the author
/// @notice Explain to an end user what this does
/// @dev Explain to a developer any extra details
contract ERC20SNKT {
  string public constant name = "SANKET";
  string public constant symbol = "SNKT";
  uint public constant decimal = 18;

  event Approval(address indexed tokenOwner, address indexed spender, uint tokens);
  event Transfer(address indexed from, address indexed to, uint tokens);

  mapping(address => uint256) balances;
  mapping(address => mapping(address => uint256)) allowed;
  uint256 _totalSupply;

  using safeMath for uint256;

  constructor(uint256 total) public {
    _totalSupply = total;
    balances[msg.sender] = _totalSupply;
  }

  function totalSupply() public view returns (uint256) {
    return _totalSupply;
  }

  function balanceOf(address tokenOwner) public view returns (uint256) {
    return balances[tokenOwner];
  }

  function transfer(address receiver, uint tokenCount) public returns (bool) {
    require(tokenCount <= balances[msg.sender]);
    balances[msg.sender] = balances[msg.sender].sub(tokenCount);
    balances[receiver] = balances[receiver].add(tokenCount);
    emit Transfer(msg.sender, receiver, tokenCount);
    return true;
  }

  function approve(address delegate, uint tokenCount) public returns (bool) {
    allowed[msg.sender][delegate] = tokenCount;
    emit Approval(msg.sender, delegate, tokenCount);
    return true;   
  }

  function TransferFrom(address owner, address buyer, uint tokenCount) public returns (bool) {
    require(tokenCount <= balances[owner]);
    require(tokenCount <= allowed[owner][msg.sender]);

    balances[owner] = balances[owner].sub(tokenCount);
    allowed[owner][msg.sender] = allowed[owner][msg.sender].sub(tokenCount);
    balances[buyer] = balances[buyer].add(tokenCount);
    emit Transfer(owner, buyer, tokenCount);
    return true;
  }
}

library safeMath {
  function sub(uint256 a, uint256 b) internal pure returns (uint256) {
    assert(b <= a);
    return a-b;
  }

  function add(uint256 a, uint256 b) internal pure returns (uint256) {
    uint256 c = a+b;
    assert(c >= a);
    return c;
  }
}

